function initChart() {
    Chart.defaults.global.responsive = true;
    Chart.defaults.global.defaultColor = '#21252e';
    Chart.defaults.global.defaultFontColor = '#21252e';
    Chart.defaults.global.defaultFontFamily = 'Nunito';
    Chart.defaults.global.defaultFontSize = 13;
    Chart.defaults.global.legend.display = false;
    Chart.defaults.global.legend.position = 'bottom';
    Chart.defaults.global.legend.labels.usePointStyle = true;
    Chart.defaults.global.legend.labels.boxWidth = 8;
    Chart.defaults.global.legend.labels.padding = 15;
    Chart.defaults.global.maintainAspectRatio = false;
    Chart.defaults.global.elements.point.radius = 0;
    Chart.defaults.global.elements.point.backgroundColor = '#de0065';
    Chart.defaults.global.elements.line.tension = 0.4;
    Chart.defaults.global.elements.line.borderWidth = 3;
    Chart.defaults.global.elements.line.borderColor = '#de0065';
    Chart.defaults.global.elements.line.borderCapStyle = 'rounded';
    Chart.defaults.global.elements.line.backgroundColor = 'transparent';
    Chart.defaults.global.elements.rectangle.backgroundColor = '#de0065';
    Chart.defaults.doughnut.cutoutPercentage = 85;
    Chart.defaults.doughnut.legend.display = true;
    Chart.defaults.global.tooltips.bodyFontColor = '#21252e';
    Chart.defaults.global.tooltips.borderWidth = 1;
    Chart.defaults.global.tooltips.borderColor = '#f8fafb';
    Chart.defaults.global.tooltips.backgroundColor = '#fff';
    Chart.defaults.global.tooltips.caretPadding = 10;
    Chart.defaults.global.tooltips.displayColors = false;
    Chart.defaults.global.tooltips.titleFontColor = '#21252e';
    Chart.defaults.global.tooltips.titleFontStyle = 600;
    Chart.defaults.global.tooltips.titleMarginBottom = 10;
    Chart.defaults.global.tooltips.xPadding = 15;
    Chart.defaults.global.tooltips.yPadding = 15;
    Chart.defaults.global.tooltips.intersect = false;
    Chart.scaleService.updateScaleDefaults('linear', {
        gridLines: {
            borderDash: [2],
            borderDashOffset: [2],
            color: '#f8fafb',
            drawBorder: false,
            drawTicks: false,
            zeroLineColor: '#f8fafb',
            zeroLineBorderDash: [2],
            zeroLineBorderDashOffset: [2],
        },
        ticks: {
            beginAtZero: true,
            padding: 10,
            callback: function (e) {
                if (!(e % 10)) return e;
            },
        },
    });
    Chart.scaleService.updateScaleDefaults('category', {
        gridLines: {
            drawBorder: false,
            drawOnChartArea: false,
            drawTicks: false,
        },
        ticks: {
            padding: 20,
        },
        maxBarThickness: 10,
    });
}

function initList() {
    var lists = document.querySelectorAll('[data-toggle="lists"]');

    [].forEach.call(lists, function (item) {
        var options = item.dataset.options;
        options = options ? JSON.parse(options) : {};
        var list = new List(item, options);
    });
}

function initTable() {
    var tables = document.querySelectorAll('[data-toggle="table"]');

    [].forEach.call(tables, function (table) {
        $(table).DataTable();
    });
}

function initSelect() {
    var selects = document.querySelectorAll('[data-toggle="select"]');

    [].forEach.call(selects, function (select) {
        var options = select.dataset.options;
        options = options ? JSON.parse(options) : {};
        $(select).select2(options);
    });
}

function initDatePicker() {
    var datepickers = document.querySelectorAll('[data-toggle="datepicker"]');

    [].forEach.call(datepickers, function (datepicker) {
        var options = {},
            data = datepicker.dataset;

        if (typeof data.single !== 'undefined') {
            options.singleDatePicker = data.single === 'true';
        }

        if (typeof data.opens !== 'undefined') {
            options.opens = data.opens;
        }

        if (typeof data.format !== 'undefined') {
            options.locale = {
                format: data.format,
            };
        }

        $(datepicker).daterangepicker(options);
    });
}

function initEditor() {
    var editors = document.querySelectorAll('[data-toggle="editor"]');

    [].forEach.call(editors, function (editor) {
        var options = {};

        options.theme = 'snow';

        new Quill(editor, options);
    });
}

function initTooltip() {
    var tooltipTriggerList = [].slice.call(document.querySelectorAll('[data-toggle="tooltip"]'));
    var tooltipList = tooltipTriggerList.map(function (tooltipTriggerEl) {
        return new bootstrap.Tooltip(tooltipTriggerEl);
    });
}

function hideLoader() {
    $('.loader').hide();
}

//
// Ready
// --------------------------------------------------

$(document).ready(function () {
    initChart();
    initList();
    initTable();
    initSelect();
    initDatePicker();
    initEditor();
    initTooltip();
});

//
// Load
// --------------------------------------------------

$(window).on('load', function () {
    hideLoader();
});

'use strict';

//
// Functions
// --------------------------------------------------

function initDemoSelect() {

    if (document.getElementById('demo-select-ajax') !== null) {

        var formatResult = function (repo) {

            if (repo.loading) {
                return repo.text;
            }

            return repo.full_name;
        }

        var formatSelection = function (repo) {
            return repo.name || repo.text;
        }

        $("#demo-select-ajax").select2({
            ajax: {
                url: 'https://api.github.com/search/repositories',
                dataType: 'json',
                delay: 250,
                data: function (params) {
                    return {
                        q: params.term, // search term
                        page: params.page
                    };
                },
                processResults: function (data, params) {
                    // parse the results into the format expected by Select2
                    // since we are using custom formatting functions we do not need to
                    // alter the remote JSON data, except to indicate that infinite
                    // scrolling can be used
                    params.page = params.page || 1;

                    return {
                        results: data.items,
                        pagination: {
                            more: (params.page * 30) < data.total_count
                        }
                    };
                },
                cache: true
            },
            placeholder: 'Search for a repository',
            minimumInputLength: 1,
            templateResult: formatResult,
            templateSelection: formatSelection
        });
    }
}

function initDemoDateRange() {

    if (document.getElementById('demo-report') !== null) {

        var $report = $('#demo-report'),
            start = moment().subtract(29, 'days'),
            end = moment();

        function cb(start, end) {
            $report.html(start.format('MMMM D') + ' - ' + end.format('MMMM D'));
        }

        $report.daterangepicker({
            startDate: start,
            endDate: end,
            opens: 'left',
            ranges: {
                'Today': [moment(), moment()],
                'Yesterday': [moment().subtract(1, 'days'), moment().subtract(1, 'days')],
                'Last 7 Days': [moment().subtract(6, 'days'), moment()],
                'Last 30 Days': [moment().subtract(29, 'days'), moment()],
                'This Month': [moment().startOf('month'), moment().endOf('month')],
                'Last Month': [moment().subtract(1, 'month').startOf('month'), moment().subtract(1, 'month').endOf('month')]
            }
        }, cb);

        cb(start, end);
    }
}

