function initDemoTable() {

    if (document.getElementById('demo-table') !== null) {

        var table = document.getElementById('demo-table');

        var options = {};
        options.language = {
            search: '_INPUT_',
            searchPlaceholder: 'Search'
        };
        options.columnDefs = [{
            targets: 'no-sort',
            orderable: false
        }];
        options.order = [];
        options.initComplete = function () {

            $('.dataTables_length, .dataTables_filter').hide();
            $('.dataTables_paginate').addClass('pagination-sm');

            $('.dataTables_paginate').appendTo('#demo-table-pagination');
            $('.dataTables_info').appendTo('#demo-table-info');
        };

        var dataTable = $(table).DataTable(options);

        if (document.getElementById('demo-table-search') !== null) {

            var tableSearch = document.getElementById('demo-table-search');

            tableSearch.addEventListener('keyup', function () {
                dataTable.search(this.value).draw();
            });
        }

        if (document.getElementById('demo-table-select-all') !== null) {

            var tableSelectAll = document.getElementById('demo-table-select-all'),
                tableSelects = document.querySelectorAll('[name="demo-table-select"]');

            tableSelectAll.addEventListener('change', function () {
                [].forEach.call(tableSelects, function (tableSelect) {
                    tableSelect.checked = tableSelectAll.checked;
                });
            });
        }

        if (document.getElementById('demo-table-min-age') !== null && document.getElementById('demo-table-max-age') !== null) {

            var tableMinAge = document.getElementById('demo-table-min-age'),
                tableMaxAge = document.getElementById('demo-table-max-age');

            $.fn.dataTable.ext.search.push(
                function (settings, data, dataIndex) {
                    var min = parseInt(tableMinAge.value, 10);
                    var max = parseInt(tableMaxAge.value, 10);
                    var age = parseFloat(data[4]) || 0; // use data for the age column

                    if ((isNaN(min) && isNaN(max)) ||
                        (isNaN(min) && age <= max) ||
                        (min <= age && isNaN(max)) ||
                        (min <= age && age <= max)) {
                        return true;
                    }
                    return false;
                }
            );

            tableMinAge.addEventListener('keyup', function () {
                dataTable.draw();
            });

            tableMaxAge.addEventListener('keyup', function () {
                dataTable.draw();
            });
        }
    }
}

function initDemoMap() {

    if (document.getElementById('demo-map') !== null) {

        var $map = $('#demo-map'),
            markers = [
                {
                    latLng: [52.5167, 13.3833],
                    name: 'Berlin',
                    size: 253
                },
                {
                    latLng: [48.8567, 2.3508],
                    name: 'Paris',
                    size: 150
                },
                {
                    latLng: [35.6833, 139.6833],
                    name: 'Tokyo',
                    size: 98
                },
                {
                    latLng: [40.7127, -74.0059],
                    name: 'New York',
                    size: 350
                },
                {
                    latLng: [22.2783, 114.1747],
                    name: 'Hong Kong',
                    size: 60
                },
                {
                    latLng: [55.7500, 37.6167],
                    name: 'Moscow',
                    size: 75
                }
            ];

        $map.vectorMap({
            map: 'world_mill',
            backgroundColor: 'transparent',
            normalizeFunction: 'polynomial',
            zoomOnScroll: false,
            regionStyle: {
                initial: {
                    fill: '#e9ecef',
                    stroke: 'none',
                    'stroke-width': 0,
                    'stroke-opacity': 0
                }
            },
            series: {
                markers: [{
                    attribute: 'fill',
                    min: 10,
                    max: 350
                }, {
                    attribute: 'r',
                    scale: [4, 8],
                    values: markers.reduce(function (p, c, i) {
                        p[i] = c.size;
                        return p
                    }, {})
                }]
            },
            onMarkerTipShow: function (event, label, index) {
                label.html(markers[index].name + ' (' + markers[index].size + 'k)');
            },
            markerStyle: {
                initial: {
                    fill: '#de0065',
                    stroke: 'transparent'
                },
                hover: {
                    stroke: '#de0065'
                }
            },
            markers: markers
        });
    }
}

function initDemoSideTheme() {

    if (document.getElementById('demo-theme-toggle') !== null) {

        var $side = $('.navbar-side'),
            $toogle = $('#demo-theme-toggle'),
            key = 'coco-side-bg',
            setDark = function () {

                $side.removeClass('navbar-light');
                $side.addClass('navbar-dark');
                $toogle.attr('checked', true);
            },
            setLight = function () {

                $side.removeClass('navbar-dark');
                $side.addClass('navbar-light');
                $toogle.attr('checked', false);
            };

        $toogle.change(function () {

            var checked = $(this).is(':checked');

            if (checked) setDark();
            else setLight();

            window.localStorage.setItem(key, checked ? 'dark' : 'light');
        });

        if (window.localStorage.getItem(key) === 'light') setLight();
        else setDark();
    }
}

